er odd deck of sorts, born to a line of excommunicated nobility. Mactireaithe Wolfheart, son of Hugrakkir, was no stranger to adversity. His family had long been seen as outliers for their outspoken views on Nordic independence from Imperial influence, grievances considered not so outlandish by most the citizenry given the tumultuous state of affairs rendered preceding the reign of the Akaviri Potentates and the following degradation of Cyrodiil into what many claim to be a chaos of warlords and subsequent cultural stagnation. Thanes, despite what many may conjecture regarding Nordic culture, were expected to keep a certain sense of social and political decorum befitting their station. And Mactireaithe\\'s father, did anything but that, calling to question every single civic policy carried into action by the jarl and his fellow nobles, and scrutinizing each with a lens of moral infallibility. If there was a shortage of grain during the winter months, he would ensure the rations brought in through White Pass were distributed evenly among peasant and patrician alike. When their hold was offered trade agreements through Solitude, he vied for lower taxation on imported Cyrodilic goods, keenly aware these tariffs were financially egregious and intended solely to force working class natives out of business amid an already teetering economic climate, making way for further Imperial gentrification. Hugrakkir, for all his bull-headedness, was good for the people, but in his resolve to protect them, he was left blinded to their capacity to turn against him. ',['title']='The Family Trees of Wolfheart and Nightingale\\n , Vol. I',},['Groups']=0,['SizeX']=26.456456,['Pitch']=4.646066,['Contrast']=1,['Id']=1033,['Z']=127023.786889,['Y']=39184,['SizeY']=30,['Color']=102439,['EffectType']=8503,['SizeZ']=30,['Yaw']=2.443461,['X']=108740.761087,['Roll']=0,},[136]={['Pitch']=0,['Groups']=0,['SizeX']=128,['Alpha']=1,['Contrast']=1,['Id']=1035,['Z']=125584.246589,['Y']=33752,['SizeY']=9